using bp.net.Auth.Server.Attributes;
using Microsoft.AspNetCore.Mvc;
using Microsoft.EntityFrameworkCore;
using smart.contract;
using smart.core.Models;
using smart.database;
using smart.resources;
using System.Text;

namespace smart.api.Controllers;

[Authorize]
[ApiController]
[Route("[controller]")]
public class ImageController : BaseController
{
    private readonly SmartContext _context;

    public ImageController(
        SmartContext context)
    {
        _context = context;
    }

    [HttpGet("id/{id}")]
    public async Task<IActionResult> Get(int id)
    {
        var image = await _context
            .Images
            .FirstOrDefaultAsync(i => i.Id == id);
        return image is not null
            ? File(image.Data, "image/png")
            : throw new AppException(SmartResources.Api_Ex_image_not_found);
    }

    [HttpGet("type/{type}")]
    public IActionResult Get(EImageType type)
    {
        return Ok(_context
            .Images
            .Where(i => i.Type == type)
            .Select(i => new ImageInfoDto(
                i.Id,
                i.Title,
                i.Type)));
    }

    [HttpPost]
    public async Task<IActionResult> Post(CreateImageDto dto)
    {
        try
        {
            var img = new Image
            {
                Type = dto.Type,
                Title = dto.Title,
                Data = dto.Data,
            };
            //img.Data = Convert.FromBase64String("");
            _context.Images.Add(img);
            await _context.SaveChangesAsync();
            return Ok(new ImageInfoDto(
                img.Id,
                img.Title,
                img.Type));
        }
        catch (Exception ex)
        {

        }
        return Ok();
    }

}